import React from "react";
import { View } from "react-native";
import Home from "./screens/Home";
import {
  ApolloClient,
  InMemoryCache,
  ApolloProvider,
  ApolloLink,
} from "@apollo/client";

// Initialize Apollo Client pointing to Mavely API
const client = new ApolloClient({
  // request: (operation) => {
  //   const token = "";
  //   operation.setContext({
  //     headers: {
  //       authorization: token ? `Bearer ${token}` : "",
  //     },
  //   });
  // },
  credentials:
    "Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6ImNsMW5wZnJuNTAyMWIwODI0ZTgxYWVwZjAiLCJlbWFpbCI6ImJhbGxuaWtvbGFzQHlhaG9vLmNvbSIsImlzQWRtaW4iOmZhbHNlLCJpc1Byb0FjY291bnQiOmZhbHNlLCJicmFuZFNsdWdzIjpbXSwiaWF0IjoxNjQ5MjU4MDQwLCJleHAiOjE2NTcwMzQwNDB9.3PEpvxzeHOAYjAxu8ExlZjzE_U2U43k0Z_237159TvA",
  uri: "https://mavely.top/",
  cache: new InMemoryCache(),
});

export default function App() {
  return (
    <ApolloProvider client={client}>
      <View>
        <Home />
      </View>
    </ApolloProvider>
  );
}
